It is time to #end the #war in Syria and hold all criminals accountable.  It is #time for #action, not talking at the tables in the Golden Palaces.  It is time to prepare people to live in peaceful mental health through specialized psychological and mental centers, in addition to philosophy and ethics #books that do not provide any connection to religions,because a clean and peaceful soul needs a #human mind, not an animal.  The reason behind what I write is a video circulating on the communication sites of a baby girl who is Syrian of #Kurdish origin from Afrin city in northern #Syria.  She was kidnapped and tortured, in addition to sending the video to her family and posting on social media.  The situation is very tragic, and frankly and seriously, I could not watch the video even for a second.  We cannot do foolishness and criminality and then say it is #2020.  Because the torture of a baby has nothing to do except with #backwardness.  This ignorance, recklessness, and criminality is hereditary and will be passed down to #future generations. #I am writing this #letter and sending it to anyone who #influences #public #opinion.
